Text:
@gent323
Please read previous posts before posting, it is clearly stated that this release of VS2010 doesn't need a CD key.
I don't know about VS2010 trial, but I had this problem with VS2008 trial. It had let me upgrade to Pro version in WinXP/Vista in maintenance mode, but in Win7(x64) it wouldn't let me. The field for serial was just not there. I think you can solve this issue by editing the ISO. Open the file Setup\setup.sdb with notepad, search for the section containing the phrase [Product Key], replace the key present there with YCFHQ9DWCYDKV88T2TMHG7BHP and save the ISO. Then do a fresh install.

@gent323 try this link, it worked prefectly for me (had the same issue as u).

http://stackoverflow.com/questions/453262/upgrading-visual-studio-2008-from-trial-to-full-on-windows-7-beta-build-7000

Hope it helps.
